using System.Text;

using Shared.Models;
using Shared.Requests;
using Shared.Responses;
using Shared.Services.Database;

namespace Test.API
{
[TestClass]
public class AppUnitTest
(DatabaseService database)
{
    private const string _imageWEBP200x200 =
        "";
    private const string _imageWEBP800x800 =
        "";

    private readonly Dictionary<AppRequest, AppResponse> _requestsToResponses = [];

    [TestMethod]
    public async void CRUD()
    {
        AppRequest request = new() {
            Name = "Biceps/Triceps",
            Category = CategoryEntity.CategoryOther,
            Image = Encoding.Unicode.GetBytes(ImageWEBP800x800),
        };

        var response = await database.Apps.Create(request);
        Assert.IsNotNull(response);
        Assert.IsTrue(response.Id != Guid.Empty && response.Proposed == true);

        Assert.IsTrue(response.Category == request.Category && response.Image == request.Image &&
                      response.Name == request.Name && response.Updated == false && response.Deleted == false);

        request.Id = response.Id;
        request.Name = "Cariceps";

        response = await database.Apps.Update(request);
    }
}
}
